import React from 'react';
import AddForm from './AddForm'
import TodoList from './TodoList'

function ContactsPage(props){
    return (
        <div>
        < ContactsList
        todos = {props.todos}
        setTodos = {props.setTodos}
        filteredTodos = {props.filteredTodos}
        />
        </div>
    )
}

export default ContactsPage;
